import React, { Component } from "react";
import "./rainanim.css";

class RainAnim extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return <div className="weather rain sizer4"></div>;
  }
}

export default RainAnim;
